import React from 'react';
import { Col, Container, Row } from 'reactstrap';

const Footer = () => {
    return (
        <>
        <Container>
            <Row>
                <Col className>
                Copyright &copy; FakesShop
                </Col>
            </Row>
        </Container>
        </>
    );
};

export default Footer;
